import styled from 'styled-components';


const Footer =() => {
    return (
    <footer className="footer">
        <nav>
            <a href="#header"><button>Back to Top</button></a>
        </nav>
        <small>Copyright Cutlip Development 2020</small>
    </footer>
    )
}

export default Footer;
